// client/src/App.js
import React from 'react';
import './App.css';
// Importiere deine Komponenten
import AdminDashboard from './components/AdminDashboard';

function App() {
  return (
    <div className="App">
      <AdminDashboard />
    </div>
  );
}

export default App;
